//Arreglos en JS

//puedo crear un array con 100 elementos
const arreglo = new Array(100);
//y si nececeito mas espacio para insertar,
// puedo agregar con push, no es algo estatico
arreglo.push(1);
console.log(arreglo);


//puedo crear de otra forma
const arreglo2 = [];
arreglo2.push(1);
arreglo2.push(2);
arreglo2.push(3);
arreglo2.push(4);
arreglo2.push(5);
console.log(arreglo2);
